//duck.co/ia/view/sig_figs) Goodie.\r\n\r\nDoes a few things:\r\n\r\n - Updates the Goodie to use the `text` template.\r\n - Allows input of numbers using different systems (via the `NumberStyler` GoodieRole).\r\n - Fixes a bug wherein the Goodie was not triggering if input consisted of leading zeros.\r\n - Improves triggers.\r\n - Improves handling of significant figures.\r\n\r\nI must say that in researching for this, I've repeatedly come across the ambiguity of significant figures when it comes to trailing zeros on integers without the use of scientific notation.\r\n\r\nCurrently the Goodie just counts the number of non-zero digits in the above case.",assignee:null,created_at:"2015-12-28T11:41:25Z",patch_url:"https://github.com/duckduckgo/zeroclickinfo-goodies/pull/1974.patch",user:{gravatar_id:"",subscriptions_url:"https://api.github.com/users/GuiltyDolphin/subscriptions",organizations_url:"https://api.github.com/users/GuiltyDolphin/orgs",gists_url:"https://api.github.com/users/GuiltyDolphin/gists{/gist_id}",followers_url:"https://api.github.com/users/GuiltyDolphin/followers",site_admin:!1,following_url:"https://api.github.com/users/GuiltyDolphin/following{/other_user}",url:"https://api.github.com/users/GuiltyDolphin",id:8598426,starred_url:"https://api.github.com/users/GuiltyDolphin/starred{/owner}{/repo}",avatar_url:"https://avatars.githubusercontent.com/u/8598426?v=3",repos_url:"https://api.github.com/users/GuiltyDolphin/repos",login:"GuiltyDolphin",html_url:"https://github.com/GuiltyDolphin",events_url:"https://api.github.com/users/GuiltyDolphin/events{/privacy}",received_events_url:"https://api.github.com/users/GuiltyDolphin/received_events",type:"User"},url:"https://api.github.com/repos/duckduckgo/zeroclickinfo-goodies/pulls/1974",id:54649610,base:{repo:{labels_url:"https://api.github.com/repos/duckduckgo/zeroclickinfo-goodies/labels{/name}",pulls_url:"https://api.github.com/repos/duckduckgo/zeroclickinfo-goodies/pulls{/number}",open_issues_count:328,forks